void wait_for_vsync(){
	volatile int* pixel_ctrl_ptr = (int*)0xff203020;
	int status;
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr + 3);
	
	while((status & 0x01) != 0){
		status = *(pixel_ctrl_ptr +3);
	}
}

void plot_pixel(int x, int y, short int line_color){
	    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


void draw_sqr(int x_loc, int y_loc, short int line_color, int size){
		int i; 
		int j;
		for( i = 0; i < size; i++){
			for(j = 0; j < size;j++){
				plot_pixel(x_loc +i , y_loc + j , line_color);
			}
		}
}





void draw_line(int x_start, int y_start, int x_finish, int y_finish,short int line_color){
	double y;
	int y_pos;
	double x;
	int x_pos;
	double y_dis;
	double x_dis;
	double slope;
	int i;
	
	if(x_start == x_finish && y_start == y_finish){
  		plot_pixel(x_start, y_start, line_color);
  		return;
 	}
 
	if(abs(x_finish - x_start) >= abs(y_finish-y_start)){
		if(x_start > x_finish){
			swap(&x_start, &x_finish);
			swap(&y_start, &y_finish);
		}
		
		y_dis = y_finish - y_start;
		x_dis = x_finish - x_start;
		slope = y_dis/x_dis;
			for(i = x_start; i < x_finish; i++){
				y = y_start +slope* (i - x_start);
				y_pos = round(y);
				
				plot_pixel(i, y_pos, line_color);
			}
	}

	else{
		if(y_start > y_finish){
			swap(&x_start, &x_finish);
			swap(&y_start, &y_finish);
		}
		y_dis = y_finish - y_start;
		x_dis = x_finish - x_start;
		slope = x_dis/y_dis;
			for(i = y_start; i <= y_finish; i++){
				x = x_start +slope* (i - y_start);
				x_pos = round(x);
				plot_pixel(x_pos, i, line_color);
			}
	}
}

void swap(int* x, int*y){
	int temp = *x;
	*x = *y;
	*y = temp;
}

int round(double x){
	if(x >= 0){
		int y = (int)(x+0.5);
		return y;
	}
	else{
		int y = (int)(x- 0.5);
		return y;
	}
}

void clear_screen(){
	int x,y;
	for (x = 0; x < 320; x++ ){
		for(y = 0;y < 240; y++){
			plot_pixel(x,y,0);
		}
	}

}

