void draw_many_cloud(int x, int y, short int colour){
	draw_cloud(x, y, colour);
	draw_cloud(x-50, y-20, colour);
	draw_cloud(x-200, y+10, colour);
	draw_cloud(x-100, y+20, colour);
}

void draw_moving_cloud(int* initial_x, int y_level, int speed, short int colour, int check_buffer){
	if(check_buffer==1 && (*initial_x+2*speed)<=319 && (*initial_x+2*speed)>=-50){
		draw_cloud(*initial_x+2*speed, y_level, 0x0000);
	}
	else if(check_buffer==-1 && (*initial_x+2*speed)<=319){
		draw_cloud(*initial_x+2*speed, y_level, 0x0000);
	}
	if(check_buffer==1 && *initial_x>=-50){
		draw_cloud(*initial_x, y_level, colour);
		*initial_x = *initial_x - speed;
	}
	else if(check_buffer==-1){
		draw_cloud(*initial_x, y_level, colour);
		*initial_x = *initial_x - speed;
	}
}


